void edge_padding(ac_fixed<64, 32,true> *input, ac_fixed<64, 32,true> *output){
 for (int i= N_BY_2; i< SAMPLE_SIZE + N_BY_2; i++){
  output[i]= input[i - N_BY_2];
 }

 for (int i=0; i< N_BY_2; i++){
  output[N_BY_2-1-i]= input[i+1];
  output[SAMPLE_SIZE + N_BY_2 + i] = input[SAMPLE_SIZE-2-i];
 }
}

void to_frames(ac_fixed<64, 32,true> *input, ac_fixed<16, 2,false> *ac_window, ac_fixed<64, 32,true> *output){
 for(int j = 0; j<N_FRAMES; j++){
  for(int i = 0; i<FRAME_WIDTH; i++){
   output[FRAME_WIDTH*j+i] = input[j*MFCC_STRIDE + i] * ac_window[i]; 
  }
 }
}

