void sum(ac_fixed<64,18,false> *input, ac_fixed<64, 32,true> *log_output){
 ac_fixed<64, 32,true, AC_RND, AC_SAT> log_sum;
 for(int j = 0; j<N_FRAMES; j++){
  ac_fixed<64,18,false> accum = 0; 
  for(int i = 0; i<N_BY_2PLUS1; i++){
   accum += input[N_BY_2PLUS1*j+i]; 
  }
  if(accum == 0){
   accum = ac_min_posval;
  }
   ac_math:: ac_log_pwl(accum,log_sum);
  log_output[j] = log_sum;
 }   
}


void power_spectrum(ac_fixed<64, 32,true> *inputB, ac_complex<ac_fixed<16, 3, true> > *inputA, ac_fixed<64,18,false> *output){

 for(int k =0; k < X_TOTAL/FRAME_WIDTH; k++){
  for(int j = 0; j < N_BY_2PLUS1; j++){
   ac_fixed<64,18,true> product_r = 0;
   ac_fixed<64,18,true> product_i = 0;   
   // Loop for calculate dot product
   for(int i = 0; i < FRAME_WIDTH; i++){
    ac_complex<ac_fixed<16, 3, true> > temp = inputA[i+j*FRAME_WIDTH];

    product_r = product_r + (inputB[i+k*FRAME_WIDTH] * temp.real());
    product_i = product_i + (inputB[i+k*FRAME_WIDTH] * temp.imag());
   }

   ac_fixed<64,18,false> abs_in = product_r * product_r + product_i * product_i;
   ac_fixed<64,18,false> abs_out;
   ac_math::ac_sqrt(abs_in, abs_out);
   output[j+k*N_BY_2PLUS1] = abs_out * abs_out; 
  }
 }
}

void mean(ac_fixed<64,12,true> *input, ac_fixed<64,12,true> *output){
 ac_int<7,false> ac_nframes = N_FRAMES;
 for(int i = 0; i < N_FILTERS; i++){
  ac_fixed<64,24,true> temp = 0;
  for(int j=0; j< N_FRAMES; j++){
   temp += input[j*N_FILTERS+i];
  }
  output[i]=temp/ac_nframes;
 }
}

